import React, { useEffect } from 'react'

const Edit = ({datas}) => {

  useEffect(()=>{
    let dataS = localStorage.getItem("todo")

  },[datas])
  return (
    <div>
      {datas && datas.map((item)=>{
        <p>
          {item}
        </p>
      })}
    </div>
  )
}

export default Edit
